import { Children } from "react";

import Head from "next/head";
import Header from './Header';
import '../style/style.css';
const Layout = (props) => {
    return (
        <div>
            <head>
				<link rel="stylesheet" href="https://bootswatch.com/4/flatly/bootstrap.min.css"/>
            </head>
            <Header/>
            { props.children }
        </div>
    );
};
export default Layout;
